DROP TABLE IF EXISTS `pagos`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `pagos` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `liquidacion_id` int(11) unsigned DEFAULT NULL,
  `descuento_id` int(11) unsigned DEFAULT NULL,
  `relacion_id` int(11) unsigned NOT NULL,
  `fecha` date NOT NULL,
  `monto` decimal(10,3) NOT NULL,
  `moneda` enum('Pesos','Beneficios') NOT NULL,
  `estado` enum('Pendiente','Imputado','Cancelado','Bloqueado','En Soporte') NOT NULL,
  `identificador` varchar(20) NOT NULL,
  `observacion` text NOT NULL,
  `created` datetime NOT NULL,
  `modified` datetime NOT NULL,
  `user_id` int(11) unsigned NOT NULL,
  `role_id` int(11) unsigned NOT NULL,
  `group_id` int(11) unsigned NOT NULL,
  `permissions` int(11) unsigned NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `relacion_liquidacion_pago_uk` (`relacion_id`,`liquidacion_id`,`moneda`),
  KEY `liquidacion_id` (`liquidacion_id`),
  KEY `relacion_id` (`relacion_id`),
  KEY `role_idx` (`role_id`),
  KEY `permissions_idx` (`permissions`),
  KEY `user_idx` (`user_id`),
  KEY `group_idx` (`group_id`),
  KEY `descuento_idx` (`descuento_id`),
  CONSTRAINT `pagos_ibfk_12` FOREIGN KEY (`liquidacion_id`) REFERENCES `liquidaciones` (`id`),
  CONSTRAINT `pagos_ibfk_13` FOREIGN KEY (`relacion_id`) REFERENCES `relaciones` (`id`),
  CONSTRAINT `pagos_ibfk_14` FOREIGN KEY (`user_id`) REFERENCES `usuarios` (`id`),
  CONSTRAINT `pagos_ibfk_15` FOREIGN KEY (`descuento_id`) REFERENCES `descuentos` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

